import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const LandingPage = () => {
  return (
    <Container maxWidth="md" sx={{ textAlign: 'center', mt: 8 }}>
      <Typography variant="h2" gutterBottom>Welcome to the Election App</Typography>
      <Typography variant="h5" gutterBottom>
        Your one-stop platform for managing election candidates and their details.
      </Typography>
      <Box mt={4}>
        <Button variant="contained" sx={{ backgroundColor: '#3498db', color: '#fff', mr: 2 }} component={Link} to="/candidates">
          View Candidates
        </Button>
        <Button variant="outlined" sx={{ borderColor: '#3498db', color: '#3498db' }} component={Link} to="/about">
          Learn More
        </Button>
      </Box>
    </Container>
  );
};

export default LandingPage;
